import React from 'react';
import { HashRouter, Route, } from 'react-router-dom';
import { Login, Lobby } from './containers';

const Router = () => (
  <HashRouter>
    <Route exact path="/" component={Login} />
    <Route path="/lobby" component={Lobby} />
  </HashRouter>
);

export default Router;
